import Navbar from './Navbar';
import Link from 'next/link';

const Layout=(props)=>{
    <div>
        <Link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootswatch/4.4.1/darkly/bootstrap.min.css"/>
        <Navbar/>
        <div className="container">
      {props.children}
    </div>
    </div>
}

export default Layout;
